const ContactList = ({filter, onDelete}) => {
    return (
        <ul>{filter.map(contact => (
            <li key={contact.id}>
            {contact.name}
            {contact.number}
                <button
                    type="button" id={contact.id}
                    onClick={onDelete(contact.id)}>
                    Delete
                </button>    
            </li>))}
        </ul>
    )
}

export default ContactList
